{
 	int n;
	scanf ("%d", &n);
	int a[n+5], b[n+5], c[5], d[n+5];
	if (n%2==0) {
		for (int i=0; i<n; ++i) {
			scanf ("%d", &a[i]);
			b[i]=a[i];	
			d[i]=1;	
		}
		if (ktra(b, n)) {
			for (int i=0; i<n; i+=2) {
				printf ("%d %d\n", i+1, i+2);
			}
		}
		else {
			for (int i=0; i<n-1; ++i) {
				for (int j=i+1; j<n; ++j) {
					if (a[i]>a[j]) {
						int x=a[i];
						a[i]=a[j];
						a[j]=x;
					}
				}
			}
			for (int i=0; i<n/2; ++i) {
				int x=0;
					for (int j=0; j<n; ++j) {
						while (d[j]) {
							if (b[j]==a[i] || b[j]==a[n-i-1]) {
								d[j]=0;
								c[x]=j+1;
								x++;
