	}
	
	qsort(copy,num,sizeof(int),compare);
	
	for(i=0;i<num/2;i++)
	{
		for(j=0;j<num;j++)
		{
			if(arr[j]==copy[i])
			{
				index1=j+1;
				arr[j]=-1;
				break;
			}
		}
		
		for(j=0;j<num;j++)
		{
			if(arr[j]==copy[num-1-i])
			{
				index2=j+1;
				arr[j]=-1;
				break;
			}
		}
		printf("%d %d",index1,index2);
		if(i!=num/2-1)
			printf("\n");
	}
}

int compare(void *a,void *b)
{
	return *(int*)a-*(int*)b;
