['#include<stdio.h>
#include<string.h> 
int pai[100];
void bianli(int *a,int b,int yi,int er,int i)
{
	int *m,*n,x[b/2],y[b/2],v,jia;
	for(v=0;v<yi;v++)x[v]=a[v+i];
	for(v=0;v<er;v++)y[v]=a[v+i+yi];
	m=&x[0];n=&y[0];jia=0;
	while(m<=&x[yi-1]&&n<=&y[er-1])
	{
		if(pai[*m]<pai[*n])a[i+jia]=*m,m++,jia++;
		else a[i+jia]=*n,n++,jia++;
	}
	if(m>&x[yi-1])while(n<=&y[er-1])a[i+jia]=*n,n++,jia++;
	else while(m<=&x[yi-1])a[i+jia]=*m,m++,jia++;
}
void paixu(int *a,int b,int zong)
{
	int i,sheng;
	for(i=0;i<zong-b;i+=b)bianli(a,b,b/2,b/2,i);
	sheng=zong-i;
	if(sheng>1)
	{
		if(sheng>b/2)bianli(a,b,b/2,sheng-b/2,i);
		else bianli(a,b,sheng/2,sheng-sheng/2,i);
	}
	if(b<zong)paixu(a,2*b,zong);
}
int main()
{   
	int zong,i;
	int xiabiao[100];
	scanf("%d",&zong);
	for(i=0;i<zong;i++)
	{
		scanf("%d",&pai[i]);
		xiabiao[i]=i;
	}
	paixu(xiabiao,2,zong);
	for(i=0;i<zong/2;i++)
	printf("%d %d\n",xiabiao[i]+1,xiabiao[zong-1-i]+1);
	return 0;
}


