['#include <stdio.h>

#define N 100

int a[N], idx[N], n;

void sort(int l, int r) {
    int i = l, j = r, pp = (l + r) / 2, p = a[pp], tmp;
    while (i  <= j) {
        while (a[i] < p) ++i;
        while (p < a[j]) --j;
        if (i <= j) {
            tmp = a[i]; a[i] = a[j]; a[j] = tmp;
            tmp = idx[i]; idx[i] = idx[j]; idx[j] = tmp;
            ++i; --j;
        }
    }
    if (i < r) sort(i, r);
    if (l < j) sort(l, j);
}

int main(void) {
    int i;
    scanf("%d", &n);
    for (i = 0; i < n; ++i) {
        scanf("%d", &a[i]);
        idx[i] = i + 1;
    }

    sort(0, n - 1);

    for (i = 0; i < n/2; ++i) printf("%d %d\n", idx[i], idx[n - 1 - i]);
    return 0;
}
