['#include <stdio.h>
typedef struct{unsigned short n, idx;}Card;
void MSA(unsigned short, unsigned short, Card*);
void Merge(unsigned short, unsigned short, unsigned short, Card*);
int main()
{
    Card a[100];
    unsigned short n, i;
    scanf("%hu", &n);
    for(i = 0; i < n; i++){ scanf("%hu", &a[i].n); a[i].idx = 1 + i; }
    MSA(0, n - 1, a);
    for(i = 0; i < n / 2; i++){
        printf("%hu %hu\n", a[i].idx, a[n - i - 1].idx);
    }

    return 0;
}
void MSA(unsigned short l, unsigned short r, Card* a){
    if(l < r){
        unsigned short m = (l + r) / 2;
        MSA(l, m, a); MSA(1 + m, r, a); Merge(l, m, r, a);
    }
}
void Merge(unsigned short l, unsigned short m, unsigned short r, Card* a){
    unsigned short s1 = m - l + 1, s2 = r - m, i, j;
    Card a1[s1], a2[s2];
    for(i = 0; i < s1; i++){ a1[i] = a[i + l]; }
    for(j = 0; j < s2; j++){ a2[j] = a[1 + j + m]; }
    i = 0, j = 0;
    while(i < s1 && j < s2){ a[l++] = a1[i].n < a2[j].n ? a1[i++] : a2[j++]; }
    while(i < s1){ a[l++] = a1[i++]; }
    while(j < s2){ a[l++] = a2[j++]; }
}
']

